<div class="entities" style="line-height: 2.5; direction: ltr">Structure of the human

 receptor in complex with an antithrombotic drug . P2Y receptors ( P2YRs ) , a family of purinergic G-protein-coupled receptors ( GPCRs ) , are activated by extracellular nucleotides . There are a total of eight distinct functional P2YRs expressed in human , which are subdivided into 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 - like receptors and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 - like receptors . Their ligands are generally charged molecules with relatively low bioavailability and stability in vivo , which limits our understanding of this receptor family . P2Y12R regulates platelet activation and thrombus formation , and several antithrombotic drugs targeting P2Y12R - - including the prodrugs clopidogrel ( Plavix ) and prasugrel ( 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06209
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 ) that are metabolized and bind covalently , and the nucleoside analogue ticagrelor ( DB08816 ) that acts directly on the receptor - - have been approved for the prevention of stroke and myocardial infarction . However , limitations of these drugs ( for example , a very long half-life of clopidogrel action and a characteristic adverse effect profile of ticagrelor ) suggest that there is an unfulfilled medical need for developing a new generation of P2Y12R inhibitors . Here we report the 2.6  resolution crystal structure of human P2Y12R in complex with a non-nucleotide reversible antagonist , AZD 1283 . The structure reveals a distinct straight conformation of helix V , which sets P2Y12R apart from all other known class A GPCR structures . With AZD 1283 bound , the highly conserved disulphide bridge in GPCRs between helix III and extracellular loop 2 is not observed and appears to be dynamic . Along with the details of the AZD 1283 - binding site , analysis of the extracellular interface reveals an adjacent ligand-binding region and suggests that both pockets could be required for dinucleotide binding . The structure provides essential insights for the development of improved P2Y12R ligands and allosteric modulators as drug candidates .</div>

<h2 style="margin: 0">2</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">

</mark>
 does not increase gastric muscle contractility in newborn rats . Feeding intolerance resulting from delayed gastric emptying is common in premature neonates . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01233
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ( MCP ) , the most frequently used prokinetic drug in neonates , enhances gastric muscle contractility through inhibition of dopamine receptors . Although its therapeutic benefit is established in adults , limited data are available to support its clinical use in infants . Hypothesizing that developmentally dependent differences are present , we comparatively evaluated the effect of MCP on fundus muscle contractility in newborn , juvenile , and adult rats . The muscle strips were either contracted with electrical field stimulation ( O43281 ) to induce cholinergic nerve-mediated acetylcholine release or carbachol , a cholinergic agonist acting directly on the muscarinic receptor . Although in adult rats MCP increased O43281 - induced contraction by 294  122 % of control ( P &lt; 0.01 ) , no significant effect was observed in newborn fundic muscle . MCP had no effect on the magnitude of the carbachol-induced and / or bethanechol-induced gastric muscle contraction at any age . In response to dopamine , an 80.7  5.3 % relaxation of adult fundic muscle was observed , compared with only a 8.4  8.7 % response in newborn tissue ( P &lt; 0.01 ) . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 expression was scant in neonates and significantly increased in adult gastric tissue ( P &lt; 0.01 ) . In conclusion , the lack of MCP effect on the newborn fundic muscle contraction potential relates to developmental differences in dopamine D2 receptor expression . To the extent that these novel data can be extrapolated to neonates , the therapeutic value of MCP as a prokinetic agent early in life requires further evaluation .</div>

<h2 style="margin: 0">11</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Membranous glomerulonephritis with the use of etanercept in ankylosing spondylitis . OBJECTIVE : To report a case of membranous glomerulonephritis with the use of etanercept in a patient with ankylosing spondylitis . CASE SUMMARY : A 60 - year-old female with severe ankylosing spondylitis and no history of renal disease was started on etanercept 50 mg subcutaneously once a week after standard treatment modalities failed . She had not been on any nephrotoxic drugs , including nonsteroidal antiinflammatory drugs , for over 1 year . After 2 months of etanercept therapy , the patient presented with anasarca , proteinuria , hypoalbuminemia , and normal serum creatinine . Renal biopsy showed features classic for membranous glomerulonephritis ( MGN ) . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00005
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 was discontinued , with resolution of anasarca and proteinuria over the following 3 months . DISCUSSION : Very few cases of MGN in patients with ankylosing spondylitis have been reported in the literature ; additionally , MGN following etanercept therapy has not been described in patients with ankylosing spondylitis so far . The exact pathogenesis of etanercept-induced MGN in ankylosing spondylitis is not known . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01375
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 -  antagonists have been associated with the formation of autoantibodies and induction of lupus-like ailments in patients with rheumatoid arthritis . It is possible that a similar dysregulation of the immune system might have accounted for the development of MGN in this patient . The Naranjo probability scale showed that this patient ' s MGN was probably associated with etanercept therapy . CONCLUSIONS : In addition to the well-described serious adverse drug events , including serious infections , the use of etanercept in ankylosing spondylitis can be associated with the development of MGN . Health care providers , especially rheumatologists , should be aware of this potentially serious adverse drug reaction .</div>

<h2 style="margin: 0">18</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Prasugrel : a new antiplatelet drug for the prevention and treatment of cardiovascular disease . Prasugrel , trade name 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 , is an investigational new antiplatelet drug currently under review for clinical use by the Food and Drug Administration . It is a thienopyridine analog with a structure similar to that of clopidogrel and ticlopidine . Thienopyridine derivatives inhibit platelet aggregation induced by adenosine diphosphate by irreversibly inhibiting the binding of adenosine diphosphate to the purinergic 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q9H244

</mark>
 receptor on the platelet surface . Prasugrel has been shown to be a potent antiplatelet agent with a faster , more consistent , and greater inhibition of platelet aggregation compared with clopidogrel . It is debatable , however , how effectively these pharmacologic benefits will translate to clinical benefits . The results of the large TRITON-TIMI 38 trial , which compared prasugrel and clopidogrel in patients with acute coronary syndrome who were scheduled to receive coronary stents , demonstrated a significant reduction in ischemic events , including stent thrombosis , with prasugrel , but with an increased risk of major bleeding . The exact role of prasugrel in the management of ischemic heart disease is still being defined , but the risk : benefit ratio will likely play a major role in directing the best place for therapy with this new agent .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Pharmacological Q9BWK5 mapping of age-associated changes in basal ganglia circuitry of awake rhesus monkeys . While the pathophysiological changes induced by the loss of dopamine innervation in the basal ganglia by Parkinson ' s disease ( PD ) are well studied , little is known about functional changes in the neural circuitry of this area during normal aging . Here we report the first survey of age-associated changes in the basal ganglia of behaviorally characterized , awake rhesus monkeys , using pharmacological Q9BWK5 to map responses to dopaminergic stimulation . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00714
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 , a mixed D ( 1 ) / 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P14416
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 agonist , evoked little change in the substantia nigra ( SN ) of aged animals while significantly reducing activation in young adult monkeys . Compared to young animals , both apomorphine and DB01576 ( which increases synaptic dopamine levels ) significantly increased activation of the aged rhesus globus pallidus externa ( GPe ) . In addition , the aged animals showed decreased activity in the putamen in response to DB01576 administration . Although the responses in the SN and putamen of the aged monkeys differed from those in animal models of PD , the apomorphine-evoked activation of their GPe corresponded with apomorphine-induced increases in neuronal activity seen in Parkinson ' s patients and animal models . Given the major role of the GPe in regulating motor behavior , the altered responses in the aged GPe may contribute significantly to the motor slowing and movement dysfunctions characterizing advanced age .</div>
